import React from 'react';
import Menu from './Menu';
import FormUsuario from './FormUsuario';


class RegistroUsuario extends React.Component {
    render() {
        return (
            <div>
                <Menu></Menu>
                <FormUsuario></FormUsuario>
                
            </div>
        );
    }
}

export default RegistroUsuario;
